import React from "react";
import {
  ComposableMap,
} from "react-simple-maps";

const WorldMap = () => {
  return (
    <ComposableMap projectionConfig={{ scale: 137 }} style={{ height: "700px", marginLeft: "100px" }}>
    </ComposableMap>
  )
}

export default WorldMap;
